import React, { Component } from 'react';

export class home extends Component {
    render() {
        return (
            <div className="container">
                <div className="row">
                    <div className="col-md-12">
                        <div className="panel"></div>
                    </div>
                </div>
            </div>
        );
    }
}

export default home;
